  \"2013-03-16T00:32:35.621223\",\n\t\"name\": \"geologic-map-of-florida\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Groundwork for a new geologic map of Florida
  began in the 1980s with a county-level mapping effort as part of a statewide radon
  investigation. The county maps created for the radon project were merged and modified
  to produce a new State map.The geologists from the Florida Geological Survey (FGS)
  involved in the project included Jon Arthur, Richard Green, Guy Means, Jacqueline
  Lloyd, Ken Campbell, Joel Duncan, Frank Rupert, and Tom Scott. Tom Missimer, Missimer
  International, Ft. Myers, Florida was part of the mapping team for Charlotte and
  Lee Counties. Previous mapping provided a basis for this project. Geologists involved
  in the preliminary mapping included Paulette Bond, Richard Johnson, Ed Lane, Walt
  Schmidt and Bill Yon.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
